window.bookSummaryJSON = "<p>In a world where magic has disappeared, rival nations vie for power in a continent devastated by war.</p> <p>When a young farm girl named Livia demonstrates magical powers for the first time in a century, there are many across the land that will kill to obtain her power. Duke Gothelm's tallymen, the blood-soaked Qeltine Brotherhood, and cynical mercenary Josten Cade: All are searching for Livia and the power she wields.</p> <p>But Livia finds that guardians can come from the most unlikely places...and that the old gods are returning to a world they abandoned.</p>"; 
